import styled, { css } from 'styled-components'

export const Header = styled.header`
  width: 100%;
  height: 80px;
  display: flex;
  align-items: center;
`
export const HeaderLogoBox = styled.div`
  padding-left: 90px;
`
export const HeaderLinksBox = styled.div`
font-size: 25px;
display: flex;
align-items: center;
margin-left: auto;
margin-right: 90px;
`
